import React, {Component} from 'react';


class HealRequestForm extends Component {
  constructor(props) {
    super(props);
    this.state = {value: ''};

    this.handleChange = 
    this.handleChange.bind(this);
    this.handleSubmit =
    this.handleSubmit.bind(this);
  }

  handleChange(event) {
    this.setState({value: event.target.value});
  }

  handleSubmit(event) {
    alert('A name was submitted: ' + this.state.value);
    event.preventDefault();
  }  




  render(){
      return (
<div className="heal-form">
<h1>Healing Request Form</h1>
  <h2>About the Person in need of healing</h2>
  <form onSubmit={this.handleSubmit} class="col s12">
  <label>
    Their Name:
    <input type="text" value={this.state.value} onChange={this.handleChange} name="First" />
    <input type="text" value={this.state.value} onChange={this.handleChange} name="Last" />
  </label>
  <lable>
  Their Age:
  <input type="text" value={this.state.value} onChange={this.handleChange} name="Age" />
  </lable>
  <select>
  <option value="Female">Female</option>
  <option value="Male">Male</option>
  <option selected value="--">--</option>
</select>
<h2>Where They Live</h2>
<lable>
  City:
  <input type="text" value={this.state.value} onChange={this.handleChange} name="City" />
  </lable>
  <lable>
  State or Region:
  <input type="text" value={this.state.value} onChange={this.handleChange} name="State" />
  </lable>
  <lable>
  City:
  <input type="text" value={this.state.value} onChange={this.handleChange} name="Country" />
  </lable>
  <h2>Conditions requested to heal</h2>
  <lable>
  Conditions:
  </lable>
  <textarea>
</textarea>
  <h2>Contact</h2>
  <lable>
  Your Name: 
  <input type="text" value={this.state.value} onChange={this.handleChange} name="YourName" />
  </lable>
  <lable>
  Email: 
  <input type="email" value={this.state.value} onChange={this.handleChange} name="Email" />
  </lable>

<label>
  <input type="submit" value="Submit" />
  </label>
  </form>
    </div>
      );
    }
};





export default HealRequestForm;
